        <h1 className="singlePostTitle">
          Lorem ipsum dolor sit amet consectetur.
          <div className="singlePostEdit">
<i class="fa-solid fa-pen-to-square"></i>
<i class="fa-solid fa-delete-left"></i>

          </div>
        </h1>
      </div>
    </div>
  );
}
